import './App.css';
import Nav from './component/Nav';
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
          <BrowserRouter>
      <Routes>
        <Route path="/" element={   <Nav />}>
          <Route index element={<Home />} />
          <Route path="blogs" element={<Gallery />} />
          <Route path="contact" element={<Event />} />
          <Route path="*" element={<Fe />} />
        </Route>
      </Routes>
    </BrowserRouter>

    </div>

  );
}

export default App;
